import Vue from 'vue'
import App from './App.vue'
import "bootstrap/dist/css/bootstrap.min.css"

import axios from 'axios'
import VueAxios from 'vue-axios'
import qs from 'qs';

window.Vue=Vue;

Vue.config.productionTip = false

// Vue.use(VueAxios, axios);
Vue.prototype.$ajax = axios
Vue.prototype.$qs = qs

new Vue({
    render: h => h(App),
}).$mount('#app')
